import mysql from "mysql2";

// 데이터베이스 연결
const pool = mysql.createPool(
  process.env.JAWSDB_URL ?? {
    host: 'localhost',
    user: 'root',
    database: 'week10',
    password: 'mo9040154@@',
    waitForConnections: true,
    connectionLimit: 10,
    queueLimit: 0
  }
);

// async / await 사용(동기화를 위해서 사용)
const promisePool = pool.promise();

// select query
//user테이블과 department테이블과 bus테이블의 쿼리를 선택함
export const selectSql = {
  getUsers : async () => {
    const [rows] = await promisePool.query(`select * from user`);//쿼리문
    
    return rows
  },
  getDepartment : async () => {
    const [rows] = await promisePool.query(`select * from department`);

    return rows
  },
  getBus : async () => {
    const [rows] = await promisePool.query(`select * from bus`);

    return rows
  },
}


// delete query'
//부서 테이블과 버스 테이블의 삭제
//부서 테이블은 부서의 숫자로
//버스 테이블은 버스의 숫자로 삭제
export const deleteSql = {
 

  deleteDepartment : async (data) => {//어떤 데이터를 delete할것인지 변수를 받는다.
    console.log('deleteSql.deleteDepartment:',data.Dnumber);
    const sql = `delete from department where Dnumber ="${data.Dnumber}"`;
    await promisePool.query(sql);//sql을 만들고 쿼리함수에 parameter로 넘겨줌으로써 실행함 

  },
  deleteBus : async (data) => {//bus테이블의 경우 버스넘버를 받아서 버스넘버를 delete하겠다는 뜻임
    console.log('deleteSql.deleteBus:',data.Bnumber);
    const sql = `delete from bus where Bnumber ="${data.Bnumber}"`;
    await promisePool.query(sql);

  },
}

